import './Top.css';
import Media from 'react-media';

// Top View Head component 
export default function REturnTop() {
  return (
    <Media
      queries={{
        small: '(max-width: 599px)',
        medium: '(min-width: 600px) and (max-width:1199px)',
        large: '(min-width: 1200px)',
      }}>
      {matches => (
        <>
          {matches.small && <ScreenSmall />}
          {matches.medium && <ScreenLarge />}
          {matches.large && <ScreenLarge />}
        </>
      )}
    </Media>
  );
};

export const ScreenLarge = () => (
  <div className='wrp-top-homed'>
    <PostText />
  </div>
);
export const ScreenSmall = () => (
  <div className='wrp-top-homed'>
    <PostText />
  </div>
);
export const PostText = () => (
  <p className='text-white gap-1'>

    <span>
      NOUVEAU! Échangez de l'argent en toute sécurité directement avec
</span>
    <span>
      <span style={{ color: '#ffd600' }}>Ungama</span>
      <span style={{ color: '#f50057' }}>Money</span>
    </span>
  </p>
);
